import React from "react";
import { contactFrom } from "../constants";
import Many_Fields from "../comps/Many_Fields";

const Callback = () => {
  return (
    <section className="pagecenter">
      <h1>Request a Call</h1>
      <form action="" className="grid gap-y-5">
        <Many_Fields fields={contactFrom} />
      </form>
    </section>
  );
};

export default Callback;
